import React, {useState, useEffect} from 'react';
import { getShopItems } from "../scripts/api-scripts";

const getItems = async(items) => {
    items = await getShopItems();
    return items;
}

function Shop(props){
    const [items, setItems] = useState();
    useEffect(() => {
        setItems(getItems(getItems(items)));
    })
    return (<div className="ShopContent">
        <p>{items}</p>
    </div>);
};

export default Shop;
